import styled from "styled-components";

export const Wrapper = styled.div`
    width: 100%;
    padding: 20px;
`;

export const Content = styled.div`
position: relative;

    width: 100%;

li {
   list-style: none;
   height: 250px;
   position: absolute;

}
img {
    top: 0;
    left: 0;
    width: 100%;
}
`;
